    public partial class UsersContractDeployment : UsersContractDeploymentBase
    {
        public UsersContractDeployment() : base(BYTECODE) { }
        public UsersContractDeployment(string byteCode) : base(byteCode) { }
    }

    public class UsersContractDeploymentBase : ContractDeploymentMessage
    {
        public static string BYTECODE = "";
        public UsersContractDeploymentBase() : base(BYTECODE) { }
        public UsersContractDeploymentBase(string byteCode) : base(byteCode) { }

